import React from "react";
import mc from "./home.module.scss";
import game from "../../assets/img/gaming.svg";
import Buttons from "../buttons/Buttons";

const Home = () => {
  return (
    <main className="container tac">
      <div>
        <h1 className={mc.title}>Bienvenue sur ScoreUp !</h1>
        <img src={game} alt="image de personnes qui jouent à un jeu vidéo" />
      </div>
      <h3 className={mc.subTitle}>
        Enregistrer vos meilleurs score sur votre jeu préférer avec vos amis et
        montrez qui est le meilleurs gamer !
      </h3>
      <Buttons btnHome={mc.btnHome} />
    </main>
  );
};

export default Home;
